import React from 'react';
import './App.css';


function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src= "/welcome.png" />
        <button className = "Button" onClick={() => <p>connected</p>}>
          <p className="Button_police">
            connexion
          </p>
        </button>
      </header>
      <body className= "App-header">
        <img src="/cana.png" className="App-logo" alt="logo" />
      </body>
    </div>
  );
}

export default App;
